  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Mingo
  National Wildlife Refuge outlines Refuge accomplishments during the 1974 fiscal
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  raptors, fish, and reptiles- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, and vegetation control. Resource
  management is outlined; topics include grazing and haying. A progress report on
  field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge participation, hunting,
  violations, and safety. Items of interest, and photographs are attached.\",\n\t\"owner_org\":
